wikitext.*:
本模板用于[[长标题]]中统计字数并排序

== 用法 ==
<pre>
{{长标题/begin}}
<!-- 请在这行以下插入数据 -->
{{长标题|作品 =  [[AAA]]  |简称 = BBB |原始题材 = 轻小说 | 原文字数 = 10}}
{{长标题|作品 =  [[CCCC]]  |简称 = DDDD |原始题材 = 轻小说 | 原文字数 = 5}}
{{长标题|作品 =  [[EEEEE]]  |简称 = FFFFF |原始题材 = 轻小说 | 原文字数 = 5}}
<!-- 请在这行以上插入数据 -->
{{长标题/end}}
</pre>
显示为：
{{长标题/begin}}
<!-- 请在这行以下插入数据 -->
{{长标题|作品 =  [[AAA]]  |简称 = BBB |原始题材 = 轻小说 | 原文字数 = 10}}
{{长标题|作品 =  [[CCCC]]  |简称 = DDDD |原始题材 = 轻小说 | 原文字数 = 5}}
{{长标题|作品 =  [[EEEEE]]  |简称 = FFFFF |原始题材 = 轻小说 | 原文字数 = 5}}
<!-- 请在这行以上插入数据 -->
{{长标题/end}}
如果程序统计字数出错，可以如下手动指定字数：
<pre>
{{长标题|作品 = 奇怪的名字 |简称 = 奇怪的简称 |原始题材 = 奇怪的题材 | 原文字数 = 123 | 译名字数 = 999}}
</pre>
